import styled from "styled-components";

const Title = styled.h1`
width: 329px;
height: 24px;

font-family: 'Poppins';
font-style: normal;
font-weight: 700;
font-size: 16px;
line-height: 24px;
/* identical to box height */

text-align: center;
text-transform: uppercase;
`

function MainSecTileCTA(){
    return <Title>¿A qué esperas? ¡Elige tu regalo!</Title>
}

export default MainSecTileCTA
